INSERT INTO `drupal_node_type` (`type`, `name`, `module`, `description`, `help`, `has_title`, `title_label`, `has_body`, `body_label`, `min_word_count`, `custom`, `modified`, `locked`, `orig_type`) VALUES
('page', 'Page', 'node', 'A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an "About us" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site''s initial home page.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'page'),
('story', 'Story', 'node', 'A <em>story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site''s initial home page, and provides the ability to post comments.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'story'),
('crew_file_uploads', 'Crew Uploads And Payrates', 'node', 'Handles crew file uploads and payrate selection.', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('image', 'Image', 'image', 'An image (with thumbnail). This is ideal for publishing photographs or screenshots.', '', 1, 'Title', 1, 'Body', 0, 0, 0, 1, 'image'),
('invoice', 'Job', 'invoice', 'If you want to add an job, use this content type.', '', 1, 'Title', 0, '', 0, 0, 1, 1, 'invoice'),
('crew_payrates', 'Crew Payrates', 'node', 'Create new payrates, manage existing rates', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('hidden_pages', 'Hidden Page', 'node', 'Use this page to create content that is only visible to Ace Crew Admins', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, ''),
('client_contact', 'Client Contact', 'node', 'Do not use this - this is used by system to create new contact for clients. To create a new contact, find the relevant client, edit that client and there you will the button to add new contact.', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('client', 'Client', 'node', 'Create a new client here.', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('product', 'Product', 'node', 'A product is a good or service that you wish to sell on your site.', '', 1, 'Title', 1, 'Description', 0, 1, 1, 0, ''),
('venue', 'Venue', 'node', 'Use this to add a new venue', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('fines_rates', 'Fines - Rates', 'node', 'Use this to create a new fine rate.', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('job', 'Job Create', 'node', 'Use this to create a new job', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('crew_job_session', 'Crew Job Session', 'node', 'One crew member at one session', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('job_session', 'Job Session', 'node', '', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('panel', 'Panel', 'panels_node', 'A panel layout broken up into rows and columns.', '', 1, 'Title', 1, 'Teaser', 0, 0, 0, 1, 'panel'),
('fines', 'Fines', 'node', 'To create fine.', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('uniform', 'Uniform', 'node', '', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('additional_offices', 'Additional Offices', 'node', 'Do not use this content type. This is used by the client content type.', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('accounts_details', 'Accounts Details', 'node', 'Do not use this content type', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('reminder', 'Reminder', 'node', '', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, ''),
